(5, 1, '2018-09-14 03:02:06', '2018-09-14 03:02:06', '<label> Your Name (required)\r\n    [text* your-name] </label>\r\n\r\n<label> Your Email (required)\r\n    [email* your-email] </label>\r\n\r\n<label> Subject\r\n    [text your-subject] </label>\r\n\r\n<label> Your Message\r\n    [textarea your-message] </label>\r\n\r\n[submit \"Send\"]\nHoliday Hotel \"[your-subject]\"\n[your-name] <cunguyen.dev@gmail.com>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Holiday Hotel (http://localhost:8080/xuxu/holidayshop)\ncunguyen.dev@gmail.com\nReply-To: [your-email]\n\n0\n0\n\nHoliday Hotel \"[your-subject]\"\nHoliday Hotel <cunguyen.dev@gmail.com>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on Holiday Hotel (http://localhost:8080/xuxu/holidayshop)\n[your-email]\nReply-To: cunguyen.dev@gmail.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2018-09-14 03:02:06', '2018-09-14 03:02:06', '', 0, 'http://localhost:8080/xuxu/holidayshop/?post_type=wpcf7_contact_form&p=5', 0, 'wpcf7_contact_form', '', 0),
